    "2016-07-27T22:19:28.080167",nt"name": "a-regionalized-assessment-of-the-influence-of-rural-nonpoint-source-pollution-on-the-ecolo",nt"isopen":
    false,nt"url": null,nt"notes": "The University of Kansas, Kansas Biological
    Survey (KBS) proposes a joint investigation with the University of Nebraska (Lincoln),
    and Iowa State University to assess the influence of land form and land use practices
    on the generation of NPSP in the three-state region (Kansas, Nebraska, Iowa), and
    the effect NPSP has on the physical, chemical, and biological integrity of streams
    draining watersheds in regions dominated by agriculture. In subsequent years, we
    will expand our efforts to investigate NPSP generated from other activities. The
    ultimate goal of this investigation, obtainable within a very few years, is to provide
    viable solutions to NPSP problems, solutions that provide the greatest effectiveness
    in mitigation, with the greatest flexibility and the least disruption to those currently
    responsible for NPSP. A geographically-based, regionalized approach that integrates
    several spatial scales, from the individual stream segment to the ecoregion, will
    be adopted to organize, analyze, and integrate landscape data (land form and land
    use), geophysical data (soils, topography), and environmental data (biological,
    water quality) in an attempt to assess the isolated, combined, and cumulative effects
    of various land management and land use practices on aquatic systems.",nt"license_title":
